                            margin-top: 20px;
                        }
                        .footer-2 {
                            padding-right: 20px;
                            padding-left: 20px;
                            text-align: left;
                        }
                        .footer-heading {
                            margin-top: 20px;
                        }
                        .text-field {
                            width: 260px;
